import React from "react";

import { Avatar } from "../Avatar/Avatar";
import { UserInfo } from "../UserInfo/UserInfo";

import "./User.css";

const User = (props) => {

    return (
        <div className="single-user">
            <Avatar />
            <UserInfo />
        </div>
    )
}

export { User };
